import './style.css'

export default function IconTextButton({tag, leftMargin}) {
    return (
        <button 
        style={leftMargin? {marginLeft: `${leftMargin}px`, width:"100%"} : {width:"100%"}} 
        className="icon-text-btn">{tag}</button>
    );
  }
